/**
 * Create a CustomScoreQuery over input subQuery.
 * @param subQuery the sub query whose scored is being customed. Must not be null. 
 */
public CustomScoreQuery(Query subQuery) {
  this(subQuery,null);
}

/**
 * Create a CustomScoreQuery over input subQuery.
 * @param subQuery the sub query whose scored is being customed. Must not be null. 
 */
public CustomScoreQuery(Query subQuery) {
  this(subQuery, new ValueSourceQuery[0]);
}

